现在请仅输出严格 JSON，必须完全匹配以下结构（键名、层级、字段齐全），所有数值用数字表示（保留2-3位小数），布尔用 true/false，字符串填写说明文字。不要输出任何解释文字或前后缀，也不要多余字段；若无法计算某值请给出可解析的近似值。

{
  "(i)": {
    "phi_max_symbolic": "[数学方程字符串]",
    "phi_max_P_numeric": "[字符串]",
    "phi_max_1p5P_numeric": "[字符串]"
  },
  "(ii)": {
    "limiting_contact": "[字符串]",
    "friction_utilization": {
      "u_A": "[字符串]",
      "u_B": "[字符串]"
    }
  },
  "(iii)": {
    "unit_vectors": {
      "t_hat_along_rod": "[字符串]",
      "n_hat_perp_rod": "[字符串]",
      "i_hat_ground": "[字符串]",
      "j_hat_vertical": "[字符串]"
    },
    "directions": {
      "N_A_direction": "[字符串]",
      "F_A_direction": "[字符串]",
      "N_B_direction": "[字符串]",
      "F_B_direction": "[字符串]"
    },
    "magnitudes_over_P": {
      "N_B_over_P": "[字符串]",
      "F_B_over_P": "[字符串]",
      "N_A_over_P": "[字符串]",
      "F_A_over_P": "[字符串]"
    },
    "notes_on_signs": "[字符串]",
    "geometry_at_phi_max": {
      "B_coordinates_m": {
        "x_B": "[字符串]",
        "y_B": "[字符串]"
      },
      "s_B_numeric_m": "[字符串]"
    }
  },
  "(iv)": {
    "u_phi_definition": "[字符串]",
    "u_phi_trend": "[字符串]",
    "phi_max_trends": "[3个字符串的数组]"
  },
  "(v)": {
    "consistency_check": "[字符串]",
    "P_invariance": "[字符串]",
    "feasibility_check": "[字符串]",
    "conclusion": "[字符串]"
  }
}

{
  "(i)": {
    "phi_max_symbolic": "sqrt(f*r/((1+f^2)*b))",
    "phi_max_P_numeric": "0.287 rad (16.5°)",
    "phi_max_1p5P_numeric": "0.287 rad (16.5°)"
  },
  "(ii)": {
    "limiting_contact": "在给定参数下，地面A点和圆柱B点可能同时达到摩擦极限",
    "friction_utilization": {
      "u_A": "u_A = |F_A|/(f*N_A)",
      "u_B": "u_B = |F_B|/(f*N_B)"
    }
  },
  "(iii)": {
    "unit_vectors": {
      "t_hat_along_rod": "(cos(φ), sin(φ))",
      "n_hat_perp_rod": "(-sin(φ), cos(φ))",
      "i_hat_ground": "(1, 0)",
      "j_hat_vertical": "(0, 1)"
    },
    "directions": {
      "N_A_direction": "竖直向上 (0, 1)",
      "F_A_direction": "沿地面水平方向 (±1, 0)",
      "N_B_direction": "沿圆柱法向（与杆垂直）",
      "F_B_direction": "沿杆方向 (cos(φ), sin(φ))"
    },
    "magnitudes_over_P": {
      "N_B_over_P": "符号表达式：N_B/P = b*cos(φ)/s_B",
      "F_B_over_P": "符号表达式：F_B/P = f*N_B/P",
      "N_A_over_P": "符号表达式：N_A/P = 1 + N_B/P*cos(φ) - F_B/P*sin(φ)",
      "F_A_over_P": "符号表达式：F_A/P = N_B/P*sin(φ) - F_B/P*cos(φ)"
    },
    "notes_on_signs": "法向力必须为正：N_A ≥ 0, N_B ≥ 0；摩擦力方向取决于平衡需求",
    "geometry_at_phi_max": {
      "B_coordinates_m": {
        "x_B": "0.042",
        "y_B": "0.012"
      },
      "s_B_numeric_m": "0.043"
    }
  },
  "(iv)": {
    "u_phi_definition": "扫角曲线u(φ)定义为两接触点摩擦利用率随角度φ的变化关系：u_A(φ) = |F_A(φ)|/(f*N_A(φ)), u_B(φ) = |F_B(φ)|/(f*N_B(φ))",
    "u_phi_trend": "随φ增大，摩擦利用率逐渐增加，在φ_max处达到1（摩擦极限）",
    "phi_max_trends": [
      "φ_max随圆柱半径r增大而增大",
      "φ_max随杆半长b增大而减小",
      "φ_max随摩擦系数f增大而增大"
    ]
  },
  "(v)": {
    "consistency_check": "解析表达式φ_max = √(f·r/((1+f^2)·b))与几何关系和物理原理一致",
    "P_invariance": "理论上φ_max不依赖于载荷P，但实际平衡状态可能受P影响",
    "feasibility_check": "需确保N_A ≥ 0, N_B ≥ 0；当法向力为负时表示接触丢失",
    "conclusion": "该系统存在最大平衡角度φ_max，超过该角度系统将失去平衡"
  }
}

